
create database hongbo;
use hongbo;
create table user(
	id int primary key not null auto_increment comment '主键',
    name varchar(100) comment '用户名',
    password varchar(100) comment '密码',
    grade varchar(100) comment '年级',
    school varchar(100) comment '学校',
    phone varchar(100) comment '手机号',
    note varchar(100) comment '备注',
    tuition int comment '学费'
);

create table teacher(
	id int primary key not null auto_increment comment '主键',
    name varchar(100) comment '用户名',
    password varchar(100) comment '密码',
    subject varchar(100) comment '所教科目',
    phone varchar(100) comment '手机号',
    note varchar(100) comment '备注',
    salary int comment '工资'
);

create table course(
	id int primary key not null auto_increment comment '课号',
    name varchar(100) comment '课名',
    time varchar(100) comment '上课时间',
    t_name varchar(100) comment '教师',
    t_id int comment '教师id',
    t_pay int comment '课时费-老师',
    s_pay int comment '课时费-学生',
    total_class int comment '上课总数',
    pay_class int comment '待结算课时'
);

create table relition(
	c_id int not null comment '课号',
	c_name varchar(100) comment '课名',
    s_id int comment '学生id',
    s_name varchar(100) comment '学生姓名'

);

create table history(
	c_id int not null comment '课号',
	history varchar(100) comment '上课历史记录',
    s_id int comment '学生id',
    s_name varchar(100) comment '学生姓名',
    t_pay int comment '教师费',
    s_pay int comment '学生费'
);

create table problem(
	id int primary key not null auto_increment comment '题号',
	t_id int comment '教师id',
    title varchar(100) comment '标题',
    kind varchar(10) comment '题目类型',
    context varchar(500) comment '题目内容',
    A varchar(500) comment '选项A',
    B varchar(500) comment '选项B',
    C varchar(500) comment '选项C',
    D varchar(500) comment '选项D',
    answer varchar(500) comment '答案'
);

create table exam(
	id int primary key not null auto_increment comment '考试号',
	t_id int comment '教师id',
    name varchar(100) comment '考试名',
    section varchar(100) comment '考试章节'


);

create table relition_exam(

	e_id int comment '考试号',
    p_id int comment '题号'

);

create table sent_exam(

	e_id int comment '考试号',
	c_id int comment '班级号',

    name varchar(100) comment '考试名',
    section varchar(100) comment '考试章节',
    begin varchar(50) comment '发布时间',
    last varchar(50) comment '截止时间'

);

create table stu_exam(

	e_id int comment '考试号',
	s_id int comment '学生号',
    p_id int comment '题号',
    send varchar(500) comment '学生答案',
    name varchar(50) comment '图片名字',
    address longblob comment '图片地址'


);

create table submit_exam(

	e_id int comment '考试号',
	s_id int comment '学生号',
    submit varchar(10) comment '提交状态',
    time varchar(50) comment '插入时间'

);

create table tea_view_exam(
  e_id int comment '考试号',
  c_name varchar(100) comment '课名',
  e_name varchar(100) comment '考试名',
  s_name varchar(100) comment '学生姓名',
  time varchar(100) comment '上交时间',
  last varchar(100) comment '截止时间',
  submit varchar(100) comment '提交状况'
);

create table student_exam_session(


	s_id int comment '学生号',
    already int comment '当前session',
    value int comment '实际session'

);


create table teacher_exam_session(


	t_id int comment '教师号',
    already int comment '当前session',
    value int comment '实际session'

);


create table notes_session(
   s_id int not null comment '学生id',
   n_id int not null comment '还没有看的笔记id'
);


create table notes(
	id int primary key auto_increment,
	title varchar(20) comment '标题',
    c_id int not null comment '课号',
    t_id int not null comment '教师id',
    text_content varchar(1000) comment '内容',
    img_name varchar(50) comment '图片名',
    img_content longblob comment '图片文件',
    date_time datetime comment '发布时间'
    );

create table forum
(
    id int not null auto_increment primary key comment '论坛id',
    s_id int comment '学生id',
    t_id int comment '老师id',
    title varchar(100) comment '标题',
    problem varchar(300) comment '问题',
    update_time datetime comment '发布时间',
    img_name varchar(300) comment '图片名',
    img_content longblob comment '图片文件'
)character set utf8 comment '发布论坛表';

create table reply
(   f_id int not null comment '论坛号',
    s_id int comment '学生id',
    t_id int comment '老师id',
    message varchar(300) comment '回复信息'
)character set utf8 comment '回复论坛表';

create table forum_number
(
    id int,
    s_id int comment '学生id',
    t_id int comment '老师id',
    number int
)character set utf8 comment '论坛未读表';


